import { BrowserRouter as Router, Link } from "react-router-dom";
import Todo from "./routes/Todo";

function App() {
	<Router>
		<div>
			<Link
				to="/"
				element={<Todo />}
			/>
		</div>
	</Router>;
}

export default App;
